css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("anandtech.com") {

/*ADS MUST DIE!!!!*/
.top_banner,.ad{display:none!important;}

/*I hate twitter/myspace/etc, so I'm removing the "Follow" crap*/
.follow{display:none!important;}

div a{color:#fff!important;}

/*the MAIN PAGE content*/
.body_left,
.body_right
{background:transparent!important;}

div.navigation_product a{color:#aaa!important;}
div.navigation_product a:hover{color:#fff!important;}

.subcontent{background:rgba(0,0,0,.3)!important;color:#fff!important;}
.subcontent p{color:#fff!important;}

.subcontent a{color:#7cf!important;background:none!important;}
.subcontent a:hover{color:#9ff!important;}

[class="sidepadding review"] div{color:#fff!important;}

[class="sidepadding review"] td{background:#222!important;color:#fff!important;border-color:#111!important;}
.jwfont strong{color:#fff!important;}

.subbox{background:transparent!important;}

/*the right dailytech list*/
[class="content news mb"],
[class="content twitter mb"]{background:#012!important;color:#fff!important;}
[class="content news mb"] a span,
[class="content twitter mb"] span{color:#fff!important;}
[class="content twitter mb"] span a{color:#5ac!important;}

#morefrom{background:transparent!important;color:#fff!important;}
[class="dottedheading big b"]{color:#fff!important;}

/*editor stuff*/
.fieldset fieldset{background:#111!important;color:#fff!important;}
.fieldset img{display:none!important;}
.editor-label{background:none!important;color:#fd9!important;}
input,textarea,select
{
-moz-appearance: none !important;
color:#fff!important;
border-color:#333!important;
background: #000 url("data:image/png;base64,R0lGODlhAQAUAIAAAAAAAP///ywAAAAAAQAUAAACBISPmQUAOw==") repeat-x !important;
}

/*comments*/
.bluebox{background:#111!important;border-color:#00a!important;}
[class="strip small"] a{color:#fd9!important;}
[class="strip small"]{color:#aaa!important;}
.text{color:#fff!important;}
em{color:#09f!important;}
[class="comment reply"] .c_text{background:#222!important;border-color:#333!important;}
.pages{background:#009!important;}
.pages a{color:#888!important;}
.pages a:hover{background:#03a!important;color:#fff!important;font-weight:900!important;}
.pages label{color:#fff!important;font-weight:900!important;font-size:16px!important;}

/*post icons*/
a.bluebutton span, button.bluebutton span{background:#03a!important;-moz-border-radius:5px!important;border:3px solid #009!important;}
.bluebutton{background:none!important;}
a.bluebutton span:hover, button.bluebutton span:hover{background:#f60!important;-moz-border-radius:5px!important;border:3px solid #faa!important;}

/*individual articles*/
h3{color:#fff!important;}

/*page backgrounds*/

/*navigation background*/
div.navigation_product{background-image: url("data:image/png;base64,")!important;}

/*navigation background ORANGE*/
#container_width div.header div.navigation_product div.orange{background-image: url("data:image/png;base64,")!important;}

/*the FULL background image*/
#hold_me{background-image: url("data:image/png;base64,")!important;background-color:#000!important;}

/*the Mid-Right background image*/

.containerbody{background-image: url("data:image/png;base64,")!important;background-repeat:repeat-x!important;background-color:#000!important;}

}
